// Original ISO timestamp
const original = $('Webhook').first().json.body.args.preferred_time;

// Parse original date
const originalDate = new Date(original);

// Extract year, month, day
const year = originalDate.getFullYear();
const month = String(originalDate.getMonth() + 1).padStart(2, '0');
const day = String(originalDate.getDate()).padStart(2, '0');

// Manually create ISO-like strings with time changes and same offset
const startISO = `${year}-${month}-${day}T00:01:00-07:00`;
const endISO = `${year}-${month}-${day}T23:59:00-07:00`;

// Convert to Date objects and then get Unix timestamps
const startDate = new Date(startISO).getTime();
const endDate = new Date(endISO).getTime();
const userTime = new Date(original).getTime();

// Return in desired structure
return [
  {
    json: {
      userTime: userTime,
      startDate: startDate,
      endDate: endDate
    }
  }
];
